aboutText:
Hi, Here is most of what you would want to know :
5'5 height; slim; wear a patka; wheatish; trim beard a bit; presentable but not smart/handsome; soft, polite voice; clean and decent appearence; specs; 
shy; reserved; unconfident; introvert; not fussy at all; easy going; lazy; little/no sense of humour; not very religious; cannot speak Punjabi; 
live by moral principles; not intelligent, but average; boring to most, interesting to very few; ordinary person; only child;
well settled; financially stable; work in IT as a Win. SysAdmin for a reputed multinational; travelled abroad; not ambitious; B. COM with post graduation in software; 
satisfied with an easy going, smooth, simple, ordinary life; dont expect/hope to change; enjoy eating, relaxing; dont concern myself with things that dont concern me; each day is like any other; vegetarian;
not social at all; prefer to avoid people; do not attend social functions/parties; keep in touch with few relatives; 
not good at handling situations, but manage; 
fear of driving and hence dont own a vehicle; 
hobbies include movies/eating/music/dreaming/long walks;
rarely fall sick;
beleive in companionship as foundation of long term relationships. 
A few more things I which I will talk about later. 

There is not much to my life. The above contains a fairly complete description of my the
kind of man I am, the kind of life I lead. Do not mistake it for modesty. I want the freedom to be myself forever, and long for a like minded wife. 

I expect the following :
1) Extremely honest, very good character and a good nature
2) Willing to be satisfied with a plain, simple life
3) does not get bored easily
